import React, {Component} from "react";

class File extends Component{
    render() {
        const firstName = "Afraa";
        const lastName = "Hakouk";
        const position = this.method();
        return(
            <h1> {firstName} {lastName} {position}</h1>
        );
    }
    method() {
        return(
            <h1> Is a WebDesigner </h1>
        );
    }
}

export default File;
